import React from "react";
import J_logo from '../Assets/J.png'
import { Link, NavLink } from "react-router-dom";
import '../Style/NavigationBar.css';

const NavigationBar = () => {
    
    return (
        <div className="Container">
            <img src={J_logo} alt="None"></img>
            <ul>
                <li>
                    <NavLink 
                      exact
                      to="/home" 
                      style={({isActive})=> {return isActive ? {background:"#13c2c2",color:"#000300",borderRadius:'6px'} : null}}
                      className="nav-link">Home</NavLink>
                </li>
                <li>
                    <NavLink 
                      to="/about" 
                      style={({isActive})=> {return isActive ? {background:"#13c2c2",color:"#000300",borderRadius:'6px'} : null}}
                      className="nav-link">About</NavLink>
                </li>
                <li>
                    <NavLink 
                      to="/creatorhub" 
                      style={({isActive})=> {return isActive ? {background:"#13c2c2",color:"#000300",borderRadius:'6px'} : null}}
                      className="nav-link">Creator Hub</NavLink>
                </li>
                <li>
                    <NavLink 
                      to="/article/2222" 
                      style={({isActive})=> {return isActive ? {background:"#13c2c2",color:"#000300",borderRadius:'6px'} : null}}
                      className="nav-link">Article Page</NavLink>
                </li>
            </ul>
        </div>
    );
}

export default NavigationBar;
